import React, { Component } from 'react';
import UserItem from './UsersItem';

class Users extends Component {
      state = {
           users : [
            {
                  id : 1,
                  login : 'mojombo' ,
                  avatar_url : 'https://avatars3.githubusercontent.com/u/1?s=400&v=4',
                  html_url: 'https://github.com/mojombo'
            },
            {
                  id : 2,
                  login : 'mojombo2' ,
                  avatar_url : 'https://www.w3schools.com/w3images/avatar2.png',
                  html_url: 'https://github.com/mojombo'
            },
            {
                  id :3,
                  login : '3mojombo3' ,
                  avatar_url : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR4ecL_yr2PeUHV5U7tFFz9AF-cXRjAT2wxkXjQmNOrWyS3R1j_JA&s',
                  html_url: 'https://github.com/mojombo'
            }
           ]
      }

      render() {
            return (
                  <div style = { userStyle } >
                       {this.state.users.map( (user) => (
                              <UserItem key  = { user.id} 
                                        user = { user } />
                       ))} 
                  </div>
            )
      }
}

const userStyle = {
      display : 'grid',
      gridGap : '1rem',
      gridTemplateColumns :'repeat(3, 1fr)'
};

export default Users
